import React from "react";
import {UseAuth} from "../../context/AuthContext";
import {useNavigate} from "react-router-dom";



const Home = () =>{
    const {logOut} = UseAuth();

    const handleSignOut = async () =>{
        try{
            await logOut();
        }catch (error){
            console.log(error);
        }
    };





    return(
        <div>
            <h1>helo</h1>
            <button onClick={handleSignOut}  className='border'>LogOut</button>
        </div>
    )


}
export default Home;
